"play_store_description" : "Descarcă cea mai recentă versiune a aplicației oficiale Google Cloud Print. Cu Cloud Print pentru Android poți: 

– să printezi de pe orice dispozitiv Android compatibil, pe orice imprimantă conectată la Google Cloud Print; 
– să trimiți o imagine sau un document din aplicații precum Galerie direct în Cloud Print; 
– să urmărești starea activităților de printare; 
– să procesezi invitațiile pentru imprimantă. Deschide linkurile de invitații din e-mail în Cloud Print. 
– să găsești și să înregistrezi noi imprimante compatibile cu tehnologia cloud în rețeaua locală*. 

 Este mai simplu ca niciodată să printezi de pe un dispozitiv Android. 

 Aplicația Google Cloud Print este un plugin de printare în Android KitKat, iar în versiunile Android anterioare, o aplicație independentă. Dacă actualizezi dispozitivul la versiunea KitKat, poate fi necesar să elimini manual pictograma. 
*Unele modele nu acceptă descoperirea locală. Pentru detalii, consultă manualul de configurare a imprimantei. 

Notificare privind permisiunile: 
– Agendă: aplicația Cloud Print folosește permisiunea Agendă ca să gestioneze conturile Google care interacționează cu imprimantele; 
– Stocare: aplicația Cloud Print folosește permisiunea Stocare ca să acceseze fișierele pentru care s-a solicitat printarea."

"play_store_description" : "Téléchargez la dernière version de l'application Google Cloud Print officielle. Avec Google Cloud Print pour Android, vous pouvez : 

- imprimer depuis n'importe quel appareil Android compatible sur toute imprimante connectée à Google Cloud Print ; 
- partager une photo ou un document à partir d'applications telles que la galerie directement sur Google Cloud Print ; 
- effectuer un suivi de l'état de vos tâches d'impression ; 
- traiter les invitations d'imprimantes (les liens d'invitation reçus par e-mail s'ouvrent dans Google Cloud Print) ; 
- rechercher et enregistrer de nouvelles imprimantes connectées à Internet sur le réseau local*. 

 L'impression depuis un appareil Android n'a jamais été aussi simple. 

 L'application Google Cloud Print est un plug-in d'impression sur Android KitKat, et une application indépendante sur les versions précédentes d'Android. Si vous passez à KitKat sur votre appareil, vous devrez peut-être supprimer l'icône manuellement. 
* La détection en local n'est pas disponible sur tous les modèles. Consultez le manuel de configuration de votre imprimante pour en savoir plus. 

Avis relatif aux autorisations : 
- Contacts : l'application Google Cloud Print utilise l'autorisation relative aux contacts pour gérer vos comptes Google afin d'interagir avec les imprimantes. 
- Stockage : l'application Google Cloud Print utilise l'autorisation relative au stockage pour accéder aux fichiers en vue de leur impression."

"play_store_description" : "Faça o download da última versão do app oficial do Google Cloud Print. Com o Cloud Print para Android, você pode: 

- imprimir a partir de qualquer dispositivo Android compatível em qualquer impressora conectada ao Google Cloud Print; 
- compartilhar imagens ou documentos diretamente com o Cloud Print, a partir de apps como a Galeria; 
- monitorar o status dos seus trabalhos de impressão; 
- processar convites de impressora. Abra links de convite em e-mails no Cloud Print; 
- encontrar e registrar novas impressoras prontas para a nuvem na rede local*. 

 Imprimir a partir do Android nunca foi tão fácil. 

 O app Google Cloud Print é um plug-in de impressão no Android KitKat e, em versões anteriores do Android, ele é um app independente. Se você atualizar seu dispositivo para o KitKat, talvez terá que remover o ícone manualmente. 
*Nem todos os modelos são compatíveis com a descoberta local. Consulte o manual de configuração da sua impressora para ver mais detalhes. 

Aviso de permissões: 
- Contatos: o app Cloud Print usa a permissão de contatos para gerenciar suas Contas do Google para interagir com impressoras. 
- Armazenamento: o app Cloud Print usa a permissão de armazenamento para acessar arquivos que tiveram a impressão solicitada."

"play_store_description" : "Скачайте последнюю версию официального приложения "Виртуальный принтер Google" для Android. Оно позволяет: 

– распечатывать файлы со всех поддерживаемых устройств Android на любом принтере, подключенном к сервису; 
– отправлять на печать изображения и документы из других приложений, таких как Галерея; 
– отслеживать состояние заданий печати; 
– принимать приглашения, полученные по электронной почте (ссылки можно открывать прямо в приложении); 
– находить и регистрировать новые виртуальные принтеры в локальной сети*. 

Благодаря Виртуальному принтеру распечатывать документы с устройств Android стало ещё проще. 

Виртуальный принтер Google доступен на устройствах Android 4.4 (в виде плагина) и более ранних версий (в виде отдельного приложения). Если вы обновите Android до версии 4.4, вам потребуется удалить значок приложения вручную. 
*Некоторые модели принтеров не поддерживают поиск в локальной сети. Более подробную информацию можно найти в инструкции по настройке принтера. 

Разрешения 
Контакты: доступ необходим для управления аккаунтами Google при взаимодействии с принтерами. 
Хранилище: доступ к файлам необходим для выполнения заданий печати."

"play_store_description" : "Lejupielādējiet oficiālās lietotnes Google mākoņdruka jaunāko versiju. Izmantojot operētājsistēmai Android paredzēto lietotni Mākoņdruka, varat: 

- drukāt no jebkuras saderīgas Android ierīces jebkurā printerī, kuram ir izveidots savienojums ar Google mākoņdruku; 
- kopīgot attēlus vai dokumentus no tādām lietotnēm kā Galerija tieši lietotnē Mākoņdruka; 
- izsekot savu drukas uzdevumu statusam; 
- apstrādāt printeru uzaicinājumus (no e-pasta atvērt uzaicinājumu saites lietotnē Mākoņdruka); 
- atrast un reģistrēt jaunus mākoņdrukai paredzētus printerus lokālajā tīklā.* 

 Drukāšana no Android ierīcēm vēl nekad nav bijusi tik ērta. 

 Lietotne Google mākoņdruka ir drukāšanas spraudnis operētājsistēmā Android KitKat un atsevišķa lietotne iepriekšējās Android versijās. Ja atjaunināsiet ierīces operētājsistēmu uz versiju KitKat, iespējams, būs manuāli jānoņem lietotnes ikona. 
* Ne visos modeļos tiek atbalstīta lokāla atklāšana. Detalizētu informāciju skatiet printera iestatīšanas rokasgrāmatā. 

Paziņojums par atļaujām 
- Kontaktpersonas: izmantojot kontaktpersonu atļauju, lietotnē Mākoņdruka tiek pārvaldīta Google kontu mijiedarbība ar printeriem. 
- Krātuve: izmantojot krātuves atļauju, lietotne Mākoņdruka piekļūst failiem, kurus tiek pieprasīts drukāt."

